import React from 'react';
import axios from 'axios';

const usageAPI = axios.create({
  baseURL: 'http://localhost:3000',
});

const res = usageAPI.get();

const Home = props => {
  state = {
    res: []
  };
  return(
    <div>
      <h3>Home View</h3>
    </div>
  );
};

export default Home;
